","# 전체 행의 80%에 해당하는 인덱스를 임의 선정\n","idx <- sample(1 : nrow(df), 0.8 * nrow(df))\n","\n","# 인덱스에 해당하는 행을 학습 데이터로 선정\n","df_train <- df[idx,] # 독립변수 + 종속변수\n","\n","# 인덱스에 해당하지 않는 행(-idx)을 테스트 데이터로 선정\n","df_test <- df[-idx, ] # 독립변수 + 종속변수\n","\n","# rpart()를 사용하여 의사결정나무 학습\n","model <- rpart(species ~ ., method = \"class\", data = df_train)\n","\n","# 학습된 모델을 기반으로 예측 수행\n","pred <- predict(model, df_test, type = \"class\")\n","\n","# Confusion Matrix 작성\n","cm <- table(df_test$species, pred)\n","\n","# 모델평가 - 정확도\n","acc <- (cm[1, 1] + cm[2, 2] + cm[3, 3]) / nrow(df_test)\n","print(acc)"],"metadata":{"colab":{"base_uri":"https://localhost:8080/"},"id":"AYJmPQ-afacS","executionInfo":{"status":"ok","timestamp":1667581030220,"user_tz":-540,"elapsed":843,"user":{"displayName":"Dahyeon Seo","userId":"07845694160477572866"}},"outputId":"3a1f5bc9-0031-4f1d-ab4b-b4d13ea7e8b8"},"execution_count":null,"outputs":[{"output_type":"stream","name":"stderr","text":["\n","Attaching package: ‘dplyr’\n","\n","\n","The following objects are masked from ‘package:stats’:\n","\n","    filter, lag\n","\n","\n","The following objects are masked from ‘package:base’:\n","\n","    intersect, setdiff, setequal, union\n","\n","\n"]},{"output_type":"stream","name":"stdout","text":["[1] 0.9333333\n"]}]},{"cell_type":"markdown","source":["분석모델 성능 평가 방법"],"metadata":{"id":"8D75lGdmicLw"}},{"cell_type":"code","source":["# 모델평가 - 오차행렬, caret 패키지 사용\n","install.packages(\"caret\")\n","library(caret)\n","\n","confusionMatrix(data = pred, reference = factor(df_test$species), mode = \"prec_recall\")"],"metadata":{"colab":{"base_uri":"https://localhost:8080/","height":605},"id":"uop-N4I5jrwe","executionInfo":{"status":"ok","timestamp":1667581076538,"user_tz":-540,"elapsed":25881,"user":{"displayName":"Dahyeon Seo","userId":"07845694160477572866"}},"outputId":"f65926f5-f668-4af0-d250-3f4408d1b102"},"execution_count":null,"outputs":[{"output_type":"stream","name":"stderr","text":["Installing package into ‘/u