ution_count":null,"outputs":[]},{"cell_type":"code","source":["# 학습된 모델을 기반으로 예측 수행\n","pred <- predict(model, df_test[, -1], type = \"class\")"],"metadata":{"id":"FujGWFx-kNOr"},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":["*성능평가 및 시각화*"],"metadata":{"id":"WkiGJCNYkkhR"}},{"cell_type":"code","source":["# 예측 결과와 실제값을 비교(오차행렬)\n","cm <- table(df_test$Survived, pred)\n","print(cm)\n","\n","# 모델평가 - 정확도\n","acc <- (cm[1, 1] + cm[2, 2]) / nrow(df_test)\n","print(acc)"],"metadata":{"colab":{"base_uri":"https://localhost:8080/"},"id":"izrTQjLQkl-j","executionInfo":{"status":"ok","timestamp":1667648149160,"user_tz":-540,"elapsed":311,"user":{"displayName":"Dahyeon Seo","userId":"07845694160477572866"}},"outputId":"7f846410-766b-401a-f28b-a06b4606c29f"},"execution_count":null,"outputs":[{"output_type":"stream","name":"stdout","text":["   pred\n","     0  1\n","  0 95 15\n","  1 20 49\n","[1] 0.8044693\n"]}]},{"cell_type":"markdown","source":["**타이타닉 생존자를 분류(예측)하는 전체 코드**"],"metadata":{"id":"ZS4o9IYKk7yb"}},{"cell_type":"code","source":["library(dplyr) # dplyr 패키지 임포트\n","library(ggplot2) # ggplot2 패키지 임포트\n","\n","# 의사결정나무 분류모델을 위한 패키지 임포트\n","library(rpart) # rpart() 함수 포함 패키지\n","\n","# 깃허브에 있는 csv 파일을 읽어와서 데이터프레임 df로 넣는다.\n","df = read.csv(\"https://raw.githubusercontent.com/datasciencedojo/datasets/master/titanic.csv\",\n","stringsAsFactors = TRUE)\n","\n","# Age 칼럼의 결측값을 평균으로 대치한다.\n","d_mean = mean(df$Age, na.rm = TRUE) # 결측치를 제외한 평균\n","df$Age = ifelse(is.na(df$Age), d_mean, df$Age) # 평균으로 대치\n","\n","# Embarked 칼럼의 결측값을 최빈값 S로 대치한다.\n","df$Embarked = replace(df$Embarked, df$Embarked == \"\", \"S\")\n","\n","# Sex 칼럼은 레이블 인코딩을 수행\n","# male: 1, female: 2\n","df$Sex <- as.numeric(factor(df$Sex), level = c(\"male\", \"female\"))\n","\n","# Embarked 칼럼은 레이블 인코딩을 수행\n","# C: 1, Q: 2, S: 3\n","df$Embarked <- as.numeric(factor(df$Embarked), level = c(\"C\", \"Q\", \"S\"))\n","\n","# FamilySize 변수 생성, SibSp + Parch\n","df$FamilySize <- df$SibSp + df$Parch\n","\n","# 분석 결과에 영향이 없는 변수는 제외하고, 나머지 변수로 데이터셋 재구성\n","# PassengerId, Name, Ticket, Cabin 제외\n","df <- df[, c(\"Survived\", \"Pclass\", \"Sex\", \"Age\", \"Fare\", \"Embarked\", \"FamilySize\")]\n","\n","# 난수(random) 발생을 위한 seed 값 부여\n","set.seed(123)\n","\n","# 전체 행의 80%에 해당하는 인덱스를 임의 선정\n","idx <- sample(1:nrow(df), 0.8 * nrow(df))\n","\n","# 인덱스에 해당하는 행을 학습 데이터로 선정\n","df_train <- df[idx,] # 독립변수 + 종속변수\n","\n","# 인덱스에 해당하지 않는 행(-idx)을 테스트 데이터로 선정\n","df_test <- df[-idx,] # 독립변수 + 종속변수\n","\n","# rpart()를 사용하여 의사결정나무 학습\n","model <- rpart(Survived ~ ., method = \"class\", data = df_train)\n","\n","# 학습된 모델을 기반으로 예측 수행\n","pred <- predict(model, df_test[, -1], type = \"class\")\n","\n","# 예측 결과와 실제값을 비교\n","cm <- table(df_test$Survived, pred)\n","print(cm)\n","\n","# 모델평가 - 정확도\n","acc <- (cm[1, 1] + cm[2, 2]) / nrow(df_test)\n","print(acc)"],"metadata":{"id":"bI-rwuxsk_5Y","colab":{"base_uri":"https://localhost:8080/"},"executionInfo":{"status":"ok","timestamp":1667663756982,"user_tz":-540,"elapsed":493,"user":{"displayName":"Dahyeon Seo","userId":"07845694160477572866"}},"outputId":"23f8df7a-b5c7-4be1-e87e-08198894f706"},"execution_count":null,"outputs":[{"output_type":"stream","name":"stdout","text":["   pred\n","     0  1\n","  0 95 15\n","  1 20 49\n","[1] 0.8044693\n"]}]},{"cell_type":"markdown","source":["*의사결정나무 최적화*"],"metadata":{"id":"2fqsQNMcgZxG"}},{"cell_type":"code","source":["# 모델 복잡도(cp) 출력\n","printcp(model)"],"metadata":{"colab":{"base_uri":"https://localhost:8080/"},"id":"PTwDQDTwglaa","executionInfo":{"status":"ok","timestamp":1667663850632,"user_tz":-540,"elapsed":275,"user":{"displayName":"Dahyeon Seo","userId":"07845694160477572866"}},"outputId":"aad0df26-9f67-4100-c6ad-04eb8013b17f"},"execution_count":null,"outputs":[{"output_type":"stream","name":"stdout","text":["\n","Classification tree:\n","rpart(formula = Survived ~ ., data = df_train, method = \"class\")\n","\n","Variables actually used in tree construction:\n","[1] Age    Fare   Pclass Sex   \n","\n","Root node error: 273/712 = 0.38343\n","\n","n= 712 \n","\n","        CP nsplit rel error  xerror     xstd\n","1 0.450549      0   1.00000 1.00000 0.047524\n","2 0.032967      1   0.54945 0.54945 0.039858\n","3 0.025641      3   0.48352 0.52747 0.039260\n","4 0.014652      4   0.45788 0.49451 0.038314\n","5 0.010000      6   0.42857 0.50183 0.038529\n"]}]},{"cell_type":"code","source":["# 의사결정나무 가지치기(최적화)\n","# 최적의 CP값보다 조금 큰 값으로 설정\n","model_opt <- prune(model, cp = 0.015)\n","printcp(model_opt)\n","\n","# 의사결정나무 시각화\n","plot(model); text(model); # 기존 모델\n","plot(model_opt); text(model_opt); # 최적화된 모델"],"metadata":{"colab":{"base_uri":"https://localhost:8080/","height":1000},"id":"66qCYJaXg9Io","executionInfo":{"status":"ok","timestamp":1667664086753,"user_tz":-540,"elapsed":3,"user":{"displayName":"Dahyeon Seo","userId":"07845694160477572866"}},"outputId":"4f33223f-3e65-4311-f26b-47c3edf6a298"},"execution_count":null,"outputs":[{"output_type":"stream","name":"stdout","text":["\n","Classification tree:\n","rpart(formula = Survived ~ ., data = df_train, method = \"class\")\n","\n","Variables actually used in tree construction:\n","[1] Age    Fare   Pclass Sex   \n","\n","Root node error: 273/712 = 0.38343\n","\n","n= 712 \n","\n","        CP nsplit rel error  xerror     xstd\n","1 0.450549      0   1.00000 1.00000 0.047524\n","2 0.032967      1   0.54945 0.54945 0.039858\n","3 0.025641      3   0.48352 0.52747 0.039260\n","4 0.015000      4   0.45788 0.49451 0.038314\n"]},{"output_type":"display_data","data":{"text/plain":["plot without title"],"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAMAAADKOT/pAAADAFBMVEUAAAABAQECAgIDAwME\nBAQFBQUGBgYHBwcICAgJCQkKCgoLCwsMDAwNDQ0ODg4PDw8QEBARERESEhITExMUFBQVFRUW\nFhYXFxcYGBgZGRkaGhobGxscHBwdHR0eHh4fHx8gICAhISEiIiIjIyMkJCQlJSUmJiYnJyco\nKCgpKSkqKiorKyssLCwtLS0uLi4vLy8wMDAxMTEyMjIzMzM0NDQ1NTU2NjY3Nzc4ODg5OTk6\nOjo7Ozs8PDw9PT0+Pj4/Pz9AQEBBQUFCQkJDQ0NERERFRUVGRkZHR0dISEhJSUlKSkpLS0tM\nTExNTU1OTk5PT09QUFB