# 독립변수 X_train, 종속 변수 y_train으로 학습\n","# X_test로 분류한 결과를 model에 저장장\n","#model <- knn(train = X_train, test = X_test, cl = y_train, k = 3)\n","#model <- knn(train = X_train, test = X_test, cl = y_train, k = 6)\n","model <- knn(train = X_train, test = X_test, cl = y_train, k = 9)\n","\n","# 모델 평가 - 오차행렬\n","c_mat <- table(y_test, model)\n","print(c_mat)\n","\n","# 모델 평가 - 정확도\n","acc <- (c_mat[1,1] + c_mat[2, 2] + c_mat[3, 3]) / nrow(X_test)\n","print(acc);"],"metadata":{"colab":{"base_uri":"https://localhost:8080/"},"id":"qVFjdnwymT98","executionInfo":{"status":"ok","timestamp":1667667355677,"user_tz":-540,"elapsed":3,"user":{"displayName":"Dahyeon Seo","userId":"07845694160477572866"}},"outputId":"0b259230-ff39-4943-ed40-a78115d96c9c"},"execution_count":null,"outputs":[{"output_type":"stream","name":"stdout","text":["            model\n","y_test       setosa versicolor virginica\n","  setosa         10          0         0\n","  versicolor      0         14         1\n","  virginica       0          0         5\n","[1] 0.9666667\n"]}]},{"cell_type":"markdown","source":["*추가 작업 해보기 - 타이타닉 데이터셋의 생존 여부 분류 문제 해결*"],"metadata":{"id":"qbAfkx_IuNfc"}},{"cell_type":"code","source":["library(dplyr)\n","library(ggplot2)\n","library(class)\n","\n","df = read.csv(\"https://raw.githubusercontent.com/datasciencedojo/datasets/master/titanic.csv\",\n","stringsAsFactor = T)\n","\n","# Age 칼럼 결측값 평균으로 대치\n","d_mean = mean(df$Age, na.rm = T)\n","df$Age = ifelse(is.na(df$Age), d_mean, df$Age)\n","\n","# Embarked 칼럼 결측값 최빈값으로 대치\n","df$Embarked = replace(df$Embarked, df$Embarked == \"\", \"S\")\n","\n","# Sex, Embarked 칼럼 레이블 인코딩\n","df$Sex = as.numeric(factor(df$Sex), level = c(\"male\", \"female\"))\n","df$Embarked = as.numeric(factor(df$Embarked), level = c(\"C\", \"Q\", \"S\"))\n","\n","# FamilySize 파생 변수 생성\n","df$FamilySize = df$SibSp + df$Parch\n","\n","# 불필요한 변수 제거\n","df = df[, c(\"Survived\", \"Pclass\", \"Sex\", \"Age\", \"Fare\", \"Embarked\", \"FamilySize\")]\n","\n","# seed 값 부여\n","set.seed(123)\n","\n","# 데이터 분할\n","idx = sample(1:nrow(df), 0.8 * nrow(df))\n","\n","# -----------------------------------\n","\n","# 인덱스에 해당하는 행을 학습 데이터로 선정\n","X_train <- df[idx, 2:7] # 독립변수\n","y_train <- df[idx, 1] # 종속변수(목표변수)\n","\n","# 인덱스에 해당하지 않는 행(-idx)을 학습 데이터로 선정\n","X_test <- df[-idx, 2:7] # 독립변수\n","y_test <- df[-idx, 1] # 종속변수(목표변수)\n","\n","# KNN 모델 학습\n","# 독립변수 X_train, 종속변수 y_train으로 학습\n","# X_test로 분류한 결과를 model에 저장\n","#model <- knn(train = X_train, test = X_test, cl = y_train, k = 3)\n","#model <- knn(train = X_train, test = X_test, cl = y_train, k = 6)\n","#model <- knn(train = X_train, test = X_test, cl = y_train, k = 9)\n","model <- knn(train = X_train, test = X_test, cl = y_train, k = 7)\n","\n","# 모델 평가 - 오차행렬\n","c_mat <- table(y_test, model)\n","c_mat\n","\n","# 모델 평가 - 정확도\n","acc <- (c_mat[1, 1] + c_mat[2, 2]) / nrow(X_test)\n","acc"],"metadata":{"colab":{"base_uri":"https://localhost:8080/","height":108},"id":"QMlR8ejquTsS","executionInfo":{"status":"ok","timestamp":1667668256166,"user_tz":-540,"elapsed":285,"user":{"displayName":"Dahyeon Seo","userId":"07845694160477572866"}},"outputId":"46c87d5e-b668-4b72-9100-3daa1c5e2ad7"},"execution_count":null,"outputs":[{"output_type":"display_data","data":{"text/plain":["      model\n","y_test  0  1\n","     0 95 15\n","     1 28 41"]},"metadata":{}},{"output_type":"display_data","data":{"text/html":["0.759776536312849"],"text/markdown":"0.759776536312849","text/latex":"0.759776536312849","text/plain":["[1] 0.7597765"]},"metadata":{}}]},{"cell_type":"markdown","source":["SVM을 이용한 분류 문제 해결"],"metadata":{"id":"W9bWqSPBxuWY"}},{"cell_type":"markdown","source":["*필요 패키지 임포트*"],"metadata":{"id":"f8BdQXk5xw4d"}},{"cell_type":"code","source":["library(dplyr) # dplyr 패키지 임포트\n","library(ggplot2) # ggplot2 패키지 임포트\n","\n","# SVM 분류모델을 위한 패키지 설치와 임포트\n","install.packages(\"e1071\")\n","library(e1071)"],"metadata":{"id":"Vi7e25jSx1ZJ","colab":{"base_uri":"https://localhost:8080/"},"executio