123)\n","\n","# 전체 행의 70%에 해당하는 인덱스를 임의 선정\n","idx <- sample(1:nrow(df), 0.7 * nrow(df))\n","\n","# 인덱스에 해당하는 행을 학습 데이터로 선정\n","df_train <- df[idx,] # 독립변수 + 종속변수\n","\n","# 인덱스에 해당하지 않는 행(-idx)을 테스트 데이터로 선정\n","df_test <- df[-idx,] # 독립변수 + 종속변수\n","\n","print(dim(df_train)) # 학습 데이터셋\n","print(dim(df_test)) # 테스트 데이터셋"],"metadata":{"colab":{"base_uri":"https://localhost:8080/"},"id":"TbmjnGbMIsDU","executionInfo":{"status":"ok","timestamp":1667708000504,"user_tz":-540,"elapsed":248,"user":{"displayName":"Dahyeon Seo","userId":"07845694160477572866"}},"outputId":"896b3425-7918-4935-959c-095fea48b20d"},"execution_count":null,"outputs":[{"output_type":"stream","name":"stdout","text":["[1] 623  10\n","[1] 268  10\n"]}]},{"cell_type":"markdown","source":["*데이터분석 수행*"],"metadata":{"id":"xfizTnwuJLs_"}},{"cell_type":"code","source":["# SVM 모델 학습\n","model <- svm(Survived ~ ., data = df_train, type = \"C-classification\")"],"metadata":{"id":"cfMRSKU4JNx5"},"execution_count":null,"outputs":[]},{"cell_type":"code","source":["# 학습된 모델을 기반으로 예측 수행\n","pred <- predict(model, df_test, type = \"class\")"],"metadata":{"id":"jZk8RR70JhV8"},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":["*성능평가 및 시각화*"],"metadata":{"id":"Q5vU2m9tJrv0"}},{"cell_type":"code","source":["# Confusion Matrix 작성\n","cm <- table(df_test$Survived, pred)\n","print(cm)\n","\n","# 모델 평가 - 정확도\n","acc <- (cm[1, 1] + cm[2, 2]) / nrow(df_test)\n","print(acc)"],"metadata":{"colab":{"base_uri":"https://localhost:8080/"},"id":"dEy6_K9ZJto-","executionInfo":{"status":"ok","timestamp":1667708206473,"user_tz":-540,"elapsed":2,"user":{"displayName":"Dahyeon Seo","userId":"07845694160477572866"}},"outputId":"ed3d9e69-cd2f-431e-dd13-18fe4a01ffa0"},"execution_count":null,"outputs":[{"output_type":"stream","name":"stdout","text":["   pred\n","      0   1\n","  0 148  20\n","  1  30  70\n","[1] 0.8134328\n"]}]},{"cell_type":"markdown","source":["**전체 코드**"],"metadata":{"id":"xBVzz7eMKGrF"}},{"cell_type":"code","source":["library(dplyr) # dplyr 패키지 임포트\n","library(ggplot2) # ggplot2 패키지 임포트\n","\n","# SVM 분류모델을 위한 패키지 설치와 임포트\n","install.packages(\"e1071\")\n","library(e1071)\n","\n","# 깃허브에 있는 csv 파일을 읽어와서 데이터프레임 df로 넣는다.\n","df = read.csv(\"https://raw.githubusercontent.com/datasciencedojo/datasets/master/titanic.csv\",\n","stringsAsFactor = TRUE)\n","\n","# Age 칼럼의 결측값을 평균으로 대치한다.\n","d_mean = mean(df$Age, na.rm = TRUE) # 결측치를 제외한 평균\n","df$Age = ifelse(is.na(df$Age), d_mean, df$Age) # 평균으로 대치\n","\n","# Embarked 칼럼의 결측값을 최빈값 S로 대치한다.\n","df$Embarked = replace(df$Embarked, df$Embarked == \"\", \"S\")\n","\n","# FamilySize 변수 생성, SibSp + Parch\n","df$FamilySize = df$SibSp + df$Parch\n","\n","# Sex 칼럼은 원-핫 인코딩을 수행\n","df <- mutate(df, Male = ifelse(df$Sex == \"male\", 1, 0))\n","df <- mutate(df, Female = ifelse(df$Sex == \"female\", 1, 0))\n","\n","# Embarked 칼럼은 원-핫 인코딩을 수행\n","df <- mutate(df, C = ifelse(df$Embarked == \"C\", 1, 0))\n","df <- mutate(df, Q = ifelse(df$Embarked == \"Q\", 1, 0))\n","df <- mutate(df, S = ifelse(df$Embarked == \"S\", 1, 0))\n","\n","# 분석 결과에 영향이 없는 변수는 제외하고, 나머지 변수로 데이터셋 재구성\n","# PassengerId, Name, Ticket, Cabin 제외\n","# Sex 대신 Male, Female, 선택, Embarked 대신 C, Q, S 선택\n","df <- df[, c(\"Survived\", \"Pclass\", \"Male\", \"Female\", \"Age\", \"Fare\", \"C\", \"Q\", \"S\", \"FamilySize\")]\n","\n","# 난수(random) 발생을 위한 seed 값 부여\n","set.seed(123) \n","\n","# 전체 행의 70%에 해당하는 인덱스를 임의 선정\n","idx <- sample(1:nrow(df), 0.7 * nrow(df))\n","\n","# 인덱스에 해당하는 행을 학습 데이터로 선정\n","df_train <- df[idx,] # 독립변수 + 종속변수\n","\n","# 인덱스에 해당하지 않는 행(-idx)을 테스트 데이터로 선정\n","df_test <- df[-idx,] # 독립변수 + 종속변수\n","\n","# SVM 모델 학습\n","model <- svm(Survived ~ ., data = df_train, type = \"C-classification\")\n","\n","# 학습된 모델을 기반으로 예측 수행\n","pred <- predict(model, df_test, type = \"class\")\n","\n","# Confusion Matrix 작성\n","cm <- table(df_test$Survived, pred)\n","print(cm)\n","\n","# 모델 평가 - 정확도\n","acc <- (cm[1, 1] + cm[2, 2]) / nrow(df_test)\n","print(acc)"],