6666666667","text/plain":["[1] 0.9666667"]},"metadata":{}}]},{"cell_type":"markdown","source":["**전체 코드**"],"metadata":{"id":"lGxonjyHtNb5"}},{"cell_type":"code","source":["library(dplyr) # dplyr 패키지 임포트\n","library(ggplot2) # ggplot2 패키지 임포트\n","\n","# 로지스틱 회귀 분류모델을 위한 패키지 임포트\n","library(nnet)\n","\n","# 깃허브에 있는 csv 파일을 읽어와서 데이터프레임 df로 넣는다.\n","df <- read.csv(\"https://raw.githubusercontent.com/mwaskom/seaborn-data/master/iris.csv\")\n","\n","# Min-Max 정규화 함수 정의\n","normal <- function(x) {\n","  return ((x - min(x)) / (max(x) - min(x)))\n","}\n","\n","# 정규화 함수 적용\n","df[1:4] <- as.data.frame(lapply(df[1:4], normal))\n","\n","# 난수(random) 발생을 위한 seed 값 부여\n","set.seed(123)\n","\n","# 150개 행의 80%인 120개 행 인덱스를 임의 선정\n","idx <- sample(1:nrow(df), 0.8 * nrow(df))\n","\n","# 인덱스에 해당하는 행을 학습 데이터로 선정\n","train_dataset <- df[idx, 1:5] \n","\n","# 인덱스에 해당하지 않는 행(-idx)을 테스트 데이터로 선정\n","test_dataset <- df[-idx, 1:5]\n","\n","# 로지스틱 회귀모델 학습\n","# 독립변수 X_train, y_train으로 학습\n","model <- multinom(formula = species ~ sepal_length + sepal_width + petal_length + petal_width,\n","data = train_dataset)\n","fitted(model)\n","\n","# 모델 평가 - 오차행렬\n","result <- predict(model, newdata = test_dataset, type = \"class\")\n","correct_model <- sum(result == test_dataset$species) / nrow(test_dataset)\n","c_mat <- xtabs( ~ result + test_dataset$species)\n","c_mat\n","\n","# 모델 평가 - 정확도\n","acc <- (c_mat[1, 1] + c_mat[2, 2] + c_mat[3, 3]) / nrow(test_dataset)\n","acc"],"metadata":{"colab":{"base_uri":"https://localhost:8080/","height":1000},"id":"ewIQh5IptOmJ","executionInfo":{"status":"ok","timestamp":1667752045224,"user_tz":-540,"elapsed":398,"user":{"displayName":"Dahyeon Seo","userId":"07845694160477572866"}},"outputId":"72e68e13-0f14-4f6d-d986-8ee5622499c0"},"execution_count":null,"outputs":[{"output_type":"stream","name":"stdout","text":["# weights:  18 (10 variable)\n","initial  value 131.833475 \n","iter  10 value 13.518787\n","iter  20 value 4.708637\n","iter  30 value 3.368639\n","iter 