","plot(df$horsepower, df$mpg)\n","abline(coef(model))\n","\n","print(\"선형 회귀모델 예측\")\n","\n","# 힉습된 모델을 기반으로 예측 수행\n","predict.lm(model, newdata = data.frame(horsepower = 140), interval = \"none\")\n","predict.lm(model, newdata = data.frame(horsepower = 140), interval = \"confidence\")\n","predict.lm(model, newdata = data.frame(horsepower = 140), interval = \"prediction\")"],"metadata":{"colab":{"base_uri":"https://localhost:8080/","height":984},"id":"YGPr4pPo4MZR","executionInfo":{"status":"ok","timestamp":1667821321107,"user_tz":-540,"elapsed":628,"user":{"displayName":"Dahyeon Seo","userId":"07845694160477572866"}},"outputId":"b1b6486d-64c7-4d6c-b2ec-8a6476a6694f"},"execution_count":null,"outputs":[{"output_type":"stream","name":"stdout","text":["[1] \"선형 회귀모델 요약\"\n"]},{"output_type":"display_data","data":{"text/plain":["\n","Call:\n","lm(formula = mpg ~ horsepower, data = df)\n","\n","Residuals:\n","     Min       1Q   Median       3Q      Max \n","-13.6235  -3.2735  -0.3726   2.7265  16.8661 \n","\n","Coefficients:\n","             Estimate Std. Error t value Pr(>|t|)    \n","(Intercept) 40.044983   0.717507   55.81   <2e-16 ***\n","horsepower  -0.158632   0.006463  -24.55   <2e-16 ***\n","---\n","Signif. codes:  0 ‘***’ 0.001 ‘**’ 0.01 ‘*’ 0.05 ‘.’ 0.1 ‘ ’ 1\n","\n","Residual standard error: 4.932 on 394 degrees of freedom\n","Multiple R-squared:  0.6046,\tAdjusted R-squared:  0.6036 \n","F-statistic: 602.5 on 1 and 394 DF,  p-value: < 2.2e-16\n"]},"metadata":{}},{"output_type":"stream","name":"stdout","text":["[1] \"선형 회귀모델 예측\"\n"]},{"output_type":"display_data","data":{"text/html":["<strong>1:</strong> 17.8364502480019"],"text/markdown":"**1:** 17.8364502480019","text/latex":"\\textbf{1:} 17.8364502480019","text/plain":["       1 \n","17.83645 "]},"metadata":{}},{"output_type":"display_data","data":{"text/html":["<table class=\"dataframe\">\n","<caption>A matrix: 1 × 3 of type dbl</caption>\n","<thead>\n","\t<tr><th></th><th scope=col>fit</th><th scope=co